var bardata = []
var mapdata = []
var linedata = []
var mapmax = 0
var mapmin = 9999999999999999
var barmax = 0
var linemin = 9999999999999999
var linemax = 0
var years = ["2007", "2008", "2009", "2010", "2011", "2012", "2013"]


function initData (){
	for (category in categorytotal){
		bardata.push({category: category, "total" : categorytotal[category]["total"]})
		if (categorytotal[category]["total"] > barmax){
	    		barmax = categorytotal[category]["total"]
    }
	}
	for (country in countrytotal){
		if (typeof(countrytotal[country]) !== "undefined"){
			mapdata.push({country: country, total: countrytotal[country]["total"]})
    	if (countrytotal[country]["total"] > mapmax){
    		mapmax = countrytotal[country]["total"]
    	}
    	if (countrytotal[country]["total"] < mapmin){
    		if (countrytotal[country]["total"] > 0)	    		{
    		mapmin = countrytotal[country]["total"]
	    	}
	    }
    }
	}
	i= 0
	for (year in categorytotal){
		if (i == 0){
			linedata.push(["2007" , categorytotal[category]["2007"]])
			linedata.push(["2008" , categorytotal[category]["2008"]])
			linedata.push(["2009" , categorytotal[category]["2009"]])
			linedata.push(["2010" , categorytotal[category]["2010"]])
			linedata.push(["2011" , categorytotal[category]["2011"]])
			linedata.push(["2012" , categorytotal[category]["2012"]])
			linedata.push(["2013" , categorytotal[category]["2013"]])
		}
		else {
			linedata[0][1] += categorytotal[category]["2007"]
			linedata[1][1] += categorytotal[category]["2008"]
			linedata[2][1] += categorytotal[category]["2009"]
			linedata[3][1] += categorytotal[category]["2010"]
			linedata[4][1] += categorytotal[category]["2011"]
			linedata[5][1] += categorytotal[category]["2012"]
			linedata[6][1] += categorytotal[category]["2013"]
		}
		i +=1
	}
}

// Map
//////////////////////////////////////////////////////////////////////////////////////////////////////
function Map () {
	var mapwidth = $("#map").width(),
	    mapheight = mapwidth * 0.6125;
	if (mapheight > 500){
		var mapheight = 500;
	}

	var colors = d3.scale.linear()
					.range(["#d5e1fd","#001489"])
					.domain([mapmin,mapmax])

	var projection = d3.geo.mercator()
	    .center([20, 48])
	    .scale((400))

	var path = d3.geo.path()
	    .projection(projection);

	var zoom = d3.behavior.zoom()
    .translate(projection.translate())
    .scale(projection.scale())
    .scaleExtent([mapheight, 8 * mapheight])
    .on("zoom", zoomed);

	var svgmap = d3.select("#map").append("svg")
	    .attr("width", mapwidth)
	    .attr("height", mapheight)
	    .call(zoom)


	d3.json("data/world-50m.json", function(error, world) {
	  if (error) throw error;
	  var countries = topojson.feature(world, world.objects.countries).features;


// reused from datamaps
	  svgmap.selectAll(".country")
	      .data(countries)
	    .enter().insert("path", ".graticule")
	    .attr("class", function(d) { 
	      if (EU.indexOf(d.id) !== -1) {
	        return "country " + "EU " + d.id;
	      }
	      else{
	        return "country " +  d.id;
	      }
	    })
	    .attr("d", path)
	    .style("fill", function(d) {
	    	if (typeof(countrytotal[d.id]) !== "undefined"){
		    	return colors((countrytotal[d.id]["total"]))
	    	}
	    })
	    .on("click", setLinedataMap)
	    .on("mouseover", setLinedataMap)

	  svgmap.insert("path", ".graticule")
	      .datum(topojson.mesh(world, world.objects.countries, function(a, b) { return a !== b; }))
	      .attr("class", "boundary")
	      .attr("d", path);

		function setLinedataMap (d){
		 	if (typeof(countrytotal[d.id]) == "undefined"){
		 		i = 0
		 		for (year in linedata) {
			 		linedata[i][1] = 0
			 		i += 1
		 		}
				d3.select("#line").select("svg").remove()
				Line(d)
		 	}
		 	else{
		   	linedata[0][1] = countrytotal[d.id]["2007"]
				linedata[1][1] = countrytotal[d.id]["2008"]
				linedata[2][1] = countrytotal[d.id]["2009"]
				linedata[3][1] = countrytotal[d.id]["2010"]
				linedata[4][1] = countrytotal[d.id]["2011"]
				linedata[5][1] = countrytotal[d.id]["2012"]
				linedata[6][1] = countrytotal[d.id]["2013"]
				d3.select("#line").select("svg").remove()
				Line()
				d3.select("#linetitle").text([countrycode[d.id]])
		 	}
		}
	})
	function zoomed() {
	  projection.translate(d3.event.translate).scale(d3.event.scale);
	  svgmap.selectAll("path").attr("d", path);
	}
}
