// Line chart
//////////////////////////////////////////////////////////////////////////////////////////////////////
function Line (d) {
// canvas size
	var linemargin = {top: 20, right: 20, bottom: 50, left: 60},
      linewidth = 400 - linemargin.left - linemargin.right,
      lineheight = 250  - linemargin.top - linemargin.bottom;

	var parseDate = d3.time.format("%Y").parse
		// bisectDate = d3.bisector(function(d) { return d[0]; }).left;

	// scaling
	var x = d3.time.scale()
	    .range([0, linewidth]);

	var y = d3.scale.linear()
	    .range([lineheight, 0]);

	var xAxis = d3.svg.axis()
	    .scale(x)
	    .orient("bottom");

	var yAxis = d3.svg.axis()
	    .scale(y)
	    .orient("left");

	// line position
	var pos = d3.svg.line()
	    .x(function(d) { return x(d[0]); })
	    .y(function(d) { return y(d[1]); });

	// canvas
	var svg = d3.select("#line").append("svg")
	    .attr("width", linewidth + linemargin.left + linemargin.right)
	    .attr("height", lineheight + linemargin.top + linemargin.bottom)
		.append("g")
	    .attr("transform", "translate(" + linemargin.left + "," + linemargin.top + ")")

	draw()

// import data and draw path and axis
	function draw () {

	  linedata.forEach(function(d) {
	  	if (typeof(d[0]) == "string"){
	    d[0] = parseDate(d[0])
	  	}
	    d[1] = d[1] / 1000000000
	  });

	  x.domain(d3.extent(linedata, function(d) { return d[0]; })).nice();
	  y.domain(d3.extent(linedata, function(d) { return d[1]; })).nice();
	  	svg.append("text")
			  .attr("y", 10)
			  .attr("x", linewidth / 2)
			  .attr("id", "linetitle")
			  .style("text-anchor", "middle")
			  .style("font-weight", "bold")
			  .text("Total")

		svg.append("g")
		  .attr("class", "x axis")
		  .attr("transform", "translate(0," + lineheight + ")")
		  .call(xAxis)
		.selectAll("text")
		  .attr("y", 10)
		  .attr("x", -40)
		  .attr("dy", ".35em")
		  .attr("transform", "rotate(-45)")
		  .style("text-anchor", "start")


		svg.append("g")
		  .attr("class", "y axis")
		  .call(yAxis)
		.append("text")
		  .attr("transform", "rotate(-90)")
		  .attr("y", 15)
		  .attr("x", 10)
		  .style("text-anchor", "end")
		  .text("€ (*Mld.)")
		 
		svg.append("path")
		   .datum(linedata)
		   .attr("class", "line")
		   .attr("d", pos)
	}
}

//////////////////////////////////////////////////////////////////////////////////////////////////////

// Bar chart
//////////////////////////////////////////////////////////////////////////////////////////////////////
function Bar () {
	var barmargin = {top: 10, right: 20, bottom: 90, left: 50},
	    barwidth = 400  - barmargin.left - barmargin.right,
	    barheight = 250  - barmargin.top - barmargin.bottom;

	var x = d3.scale.ordinal()
	    .rangeRoundBands([0, barwidth], .1);

	var y = d3.scale.linear()
	    .range([barheight, 0]);

	var xAxis = d3.svg.axis()
	    .scale(x)
	    .orient("bottom")
	    // .tickFormat("");

	var yAxis = d3.svg.axis()
	    .scale(y)
	    .orient("left")

	var svg = d3.select("#bar").insert("svg")
	    .attr("width", barwidth + barmargin.left + barmargin.right)
	    .attr("height", barheight + barmargin.top + barmargin.bottom)
	  .append("g")
	    .attr("transform", "translate(" + barmargin.left + "," + barmargin.top + ")");

    drawbar()

function drawbar () {

	  x.domain(bardata.map(function(d) { return d.category}));
	  y.domain([0, d3.max(bardata, function(d) { return d.total/ 1000000000; })]).nice();


	  svg.append("g")
	      .attr("class", "y axis")
	      .call(yAxis)
	    .append("text")
	      .attr("transform", "rotate(-90)")
	      .attr("y", -40)
	      .attr("x", 10)
	      .attr("dy", ".71em")
	      .style("text-anchor", "end")
	      .text("€ (*Mld.)")
		.selectAll("text")
		  .style("text-size", "9px");

	  svg.selectAll(".bar")
	      .data(bardata)
	    .enter().append("rect")
	      .attr("class", "bar")
	      .attr("id", function(d) {return d.category})
	      .attr("x", function(d) { return x(d.category); })
	      .attr("width", x.rangeBand())
	      .attr("y", function(d) { return y(d.total / 1000000000); })
	      .attr("height", function(d) { return barheight - y((d.total / 1000000000)) })
	      .on("click", setLinedataBar)
	      .on("mouseover", setLinedataBar)

	  svg.append("g")
	      .attr("class", "x axis")
	      .attr("transform", "translate(0," + barheight + ")")
	      .call(xAxis)
	      .selectAll("text")
	       .attr("transform", "rotate(-45)")
	       .attr("x", -5)
	       .attr("y", 5)
	       .style("text-anchor", "end")

	function setLinedataBar (d){
		linedata[0][1] = categorytotal[d.category]["2007"];
		linedata[1][1] = categorytotal[d.category]["2008"]
		linedata[2][1] = categorytotal[d.category]["2009"]
		linedata[3][1] = categorytotal[d.category]["2010"]
		linedata[4][1] = categorytotal[d.category]["2011"]
		linedata[5][1] = categorytotal[d.category]["2012"]
		linedata[6][1] = categorytotal[d.category]["2013"]
		d3.select("#line").select("svg").remove()
		Line()
		d3.select("#linetitle").text(d.category)
	}

// from: http://bl.ocks.org/mbostock/3885705
	d3.select("#sort")
		.on("change", change);

  function change() {

    var x0 = x.domain(bardata.sort(this.checked
        ? function(a, b) { return b.total - a.total; }
        : function(a, b) { return d3.ascending(a.category, b.category); })
        .map(function(d) { return d.category; }))
        .copy();

    svg.selectAll(".bar")
        .sort(function(a, b) { return x0(a.category) - x0(b.category); });

    var transition = svg.transition().duration(750),
        delay = function(d, i) { return i * 50; };

    transition.selectAll(".bar")
        .delay(delay)
        .attr("x", function(d) { return x0(d.category); });

    transition.select(".x.axis")
        .call(xAxis)
        .selectAll("text")
       .attr("transform", "rotate(-45)")
       .attr("x", -5)
       .attr("y", 5)
       .style("text-anchor", "end")
      .selectAll("g")
        .delay(delay);
  }
	}

	function type(d) {
	  d.total = +d.total;
	  return d;
	}
}

// filling the table element with content
function Table () {
	var table = d3.select("#tableheader").append("th").text("Country")
	i = 0
	for (country in countrytotal){
		if (countrytotal[country]["total"] != 0){
			d3.select("tbody").append("tr").attr("id", country).append("td").text(countrycode[country])
			d3.select(d3.select("tbody").selectAll("tr")[0][i]).append("td").text("€ " + d3.format(",f")(Number(countrytotal[country]["total"])))
			i += 1
			// d3.select("tbody").append("tr").append("td").text(countrytotal[country]["total"])
		}	
	}
}


